# Global variable of BaseAddress
.eqv BASE_ADDRESS 0x10008000


.text

##################
# Background Set up
##################

main :
# Innitial game set up and background set up
        li $s4, 0 # Number of health lose as a state (0, 1, 2, 3(loosing condition))

        #set up background
        li $t1, BASE_ADDRESS 
        li $t0, 0 # make a counter for setup background
        la $t3, background # accessing array of background
        jal setBackground 
        j restartGame 

# Section for when character get hit
restartGame:	
        li $s5, 0 # State of axe and boulder

        # Set background after the health bar
        li $t1, BASE_ADDRESS
        addi $t1, $t1, 2304 
        li $t0, 576 # make a counter
        la $t3, background
        addi $t3, $t3, 2304
        jal setBackground
                

        # Main loop prep
        li $s0, BASE_ADDRESS 
        addi $s0, $s0, 30492 # Initial position of character
        jal drawCharacter

        li $t5, 1 #Innitial state of platform, bullet, axe
        li $t9, 0xffff0000 # Set up keyboard input address

###################################################
# Main Loop
###################################################
# Main loop for character movement, gravity and state transition of moving object
mainLoop :
        # Check if character is flying
        li $s2, 0
        jal isFlying


        jal updateMoving

        # Check winning position
        jal isWinning

        lw $t8, 0($t9)
        beq $t8, 1, keypress_happened
        j mainAfterMove
        
#Continue mainLoop
mainAfterMove:
        beq $s2, 0, mainAfterGravity
        j gravity


#Continue mainLoop
mainAfterGravity:
        li $s2, 0

        li $v0, 32
        li $a0, 75 # Wait one second (1000 milliseconds)
        syscall
        j mainLoop
 
 
###################################################
# Main Loop Done
###################################################
 
isFlying :
        lw $s7, blue
        lw $s1 ,1536($s0)
        bne $s1, $s7, notFlying
        lw $s1 ,1544($s0)
        bne $s1, $s7, notFlying
        li $s2, 1
        jr $ra
	
notFlying:
        jr $ra	


gravity:
        li $s2, 1
        j respond_to_s

###################################################
# updateMoving
###################################################
updateMoving:
# t5 is state 0-19
# t4 bit increament

        lw $t2, bulletOne
        lw $t3, bulletTwo
        li $t4, 4
        mult $t5, $t4
        mflo $t4
        add $t2, $t2, $t4
        addi $t2, $t2, -4
        sub $t3, $t3, $t4
        subi $t3, $t3, -4
        j deleteBullet
	
deleteStateAfterBullet: #Deleting previous state of platform
        bgt $t5, 11 deletePlatformState
        beq $t5, 0, ifStateZero
        move $t2, $t5
        sub $t2, $t2, 1
        j deletePlatform
	
ifStateZero: #set up states and state communication to drawing function
        li $t2, 1
        j deletePlatform
	
deletePlatformState: #Deleting previous state of platform
        li $t2, 20
        sub $t2, $t2, $t5
        add $t2, $t2, 1
        j deletePlatform
	
deletePlatform: #Deleting previous state of platform 1
        lw $t4, blue
        lw $t6, platOne

