keypress_happened:
	lw $t2, 4($t9) # this assumes $t9 is set to 0xfff0000 from before
	beq $t2, 0x61, respond_to_a # ASCII code of 'a' is 0x61 or 97 in decimal
	beq $t2, 0x77, respond_to_w_prep # ASCII code of 'w' is 0x77 or 119 in decimal
	beq $t2, 0x73, respond_to_s # ASCII code of 's' is 0x73 or 115 in decimal
	beq $t2, 0x64, respond_to_d # ASCII code of 'd' is 0x64 or 100 in decimal
	beq $t2, 0x71, quit # ASCII code of 'q' is 0x71 or 113 in decimal
	beq $t2, 0x72, main # ASCII code of 'r' is 0x72 or 114 in decimal
	j mainAfterMove


