collision :
	li $s7, 1
	jr $ra

# Responding to keypress and delete previous position of character
respond_to_d: 	
	jal deleteCharacter
	addi $s0, $s0, 4
	beq $s0, 0x1000A80C, portalDraw1
	beq $s0, 0x1000A808, portalDraw2
	beq $s0, 0x1000D2EC, portalDraw1
	beq $s0, 0x1000D2E8, portalDraw2
	beq $s0, 0x1000D2E4, portalDraw3
	beq $s0, 0x1000D2F0, movePosition
 	jal checkMoveCollision
	beq $s7, 1,responseCollisionD
	j endMove
	
responseCollisionD:
	addi $s0, $s0, -4
	j endMove


respond_to_a: 
	jal deleteCharacter
	addi $s0, $s0, -4
	beq $s0, 0x1000A80C, portalDraw1
	beq $s0, 0x1000A808, portalDraw2
	beq $s0, 0x1000D2EC, portalDraw1
	beq $s0, 0x1000D2E8, portalDraw2
	beq $s0, 0x1000D2E4, portalDraw3
	beq $s0, 0x1000D2F0, movePosition

	jal checkMoveCollision
	beq $s7, 1,responseCollisionA
	j endMove
	
responseCollisionA:
	addi $s0, $s0, 4
	j endMove
	
respond_to_w_prep: #set jump counter to 0
	beq $s2, 1, mainAfterMove
	li $s3, 0
	
respond_to_w: 
	jal deleteCharacter
	addi $s0, $s0, -256
	jal checkMoveCollision
	beq $s7, 1, responseCollisionW
	
	addi $s3, $s3, 1
	jal drawCharacter
	li $v0, 32
	li $a0, 1 # Wait one second (1000 milliseconds)
	syscall
		
	blt $s3, 20, respond_to_w
	j endMove
	
responseCollisionW:
	addi $s0, $s0, 256
	j endMove
	
respond_to_s: 
	jal deleteCharacter
	addi $s0, $s0, 256
	jal checkMoveCollision
	beq $s7, 1, responseCollisionS
	j endMove
	
responseCollisionS:
	addi $s0, $s0, -256
	j endMove

# redraw the character position
endMove : 
	jal drawCharacter
	li $s7, 0
	move $t8, $zero
	move $t2, $zero
	beq $s2, 1, mainAfterGravity
	j mainAfterMove

# Got hit, increase the health loss and remove the heart
gotHit: 
	addi $s4, $s4, 1
	beq $s4, 1, deleteHeart1
	beq $s4, 2, deleteHeart2
	beq $s4, 3, failedCondition #failed
	j restartGame

