# Check winning condition
isWinning:
	bgt $s0, 0x10008EE8, notWinning
	blt $s0, 0x10008EA8, notWinning
	# enter winning screen
	li $t1, BASE_ADDRESS
        li $t0, 0 # make a counter
        la $t3, winbg
        jal setBackground
        jal drawCharacter
        j endGameLoop
        
notWinning:
	jr $ra

# Check input after the game end
endGameLoop:
        li $t9, 0xffff0000 
        lw $t8, 0($t9)
        beq $t8, 1, keypressEndGame
        j endGameLoop
        
keypressEndGame:
	lw $t2, 4($t9) # this assumes $t9 is set to 0xfff0000 from before
	beq $t2, 0x71, quit # ASCII code of 'q' is 0x71 or 113 in decimal
	beq $t2, 0x72, main # ASCII code of 'r' is 0x72 or 114 in decimal
	j endGameLoop
        

	
# Draw quitting background and terminate program 
quit : 
	li $t1, BASE_ADDRESS
        li $t0, 0 # make a counter
        la $t3, quitbg
        jal setBackground
        
        # Exit Program
	li $v0, 10
	syscall

